import React from "react";
import { Segment } from "semantic-ui-react";
import Card from "../Card/Card"


export default function Profile () {
    return (
      <Segment className="profile">
        <h1>Profile Component</h1>
        <Card /><Card /><Card />
        <Card /><Card /><Card />
        <Card /><Card /><Card />
      </Segment>
    );
  }
